import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>
          Hello World!! <br></br>Welcome to first React program.
        </h1>
      </header>
    </div>
  );
}

export default App;
